import {Ticket} from './ticket';


export var apis = {
    ticket: Ticket
};

import {RequestHandler} from '../request/handler';
import {auth} from '../auth';


export class Ticket extends RequestHandler {
    /**
     * Ticket Api
     *
     * @param {object} [custom] - Initialize Ticket Api settings.
     */
    constructor(custom = {}) {
        let settings = {
            url : 'https://api.ingresse.com/ticket',
            auth: auth.Jwt.type(),
        };

        Object.assign(settings, custom);

        super(settings);
    }

    /**
     * Get a list of ticket items
     *
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    getItems(query) {
        return this.get('/items', query);
    }

    /**
     * Get item by ID
     *
     * @param {string|number} id - The item ID to get.
     * @param {object} [query]   - Optional request parameters.
     *
     * @returns {Promise}
     */
    getItem(id, query) {
        return this.get(`/items/${id}`, query);
    }

    /**
     * Create new Ticket item
     *
     * @param {object} data    - Data to create a new ticket item.
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    newItem(data, query) {
        return this.post('/items', data, query);
    }

    /**
     * Update a ticket item
     *
     * @param {string|number} id - The item ID to update.
     * @param {object} data      - Data to update item.
     * @param {object} [query]   - Optional request parameters.
     *
     * @returns {Promise}
     */
    updateItem(id, data, query) {
        return this.put(`/items/${id}`, data, query);
    }

    /**
     * Remove a ticket item
     *
     * @param {string|number} id - The item ID to remove.
     * @param {object} [query]   - Optional request parameters.
     *
     * @returns {Promise}
     */
    removeItem(id, query) {
        return this.delete(id, query);
    }
}

export class Authentication {
    /**
     * Set authentication data
     *
     * @param {object|string} data - Authentication data.
     */
    set authData(data) {
        this._authData = data;
    }

    /**
     * Get authentication data
     *
     * @returns {object|string}
     */
    get authData() {
        return this._authData;
    }
}

import {Jwt} from './jwt';


export var auth = {
    [Jwt.type()]: Jwt
};

import {Authentication} from './authentication';


export class Jwt extends Authentication {
    constructor() {
        super();
    }

    /**
     * Type of the Authentication
     *
     * @returns {string}
     */
    static type() {
        return 'Jwt';
    }

    /**
     * Get formatted authentication settings
     *
     * @returns {object}
     */
    getSettings() {
        return {
            headers: {
                'Authorization': `Bearer ${this.getToken()}`
            }
        };
    }

    /**
     * Set authentication token value
     *
     * @param {string} token - JWT Token value
     */
    setToken(token) {
        this.authData = token;
    }

    /**
     * Get authentication token value
     *
     * @returns {string}
     */
    getToken() {
        return this.authData;
    }
}

import {apis} from './apis';
import {version} from '../package.json';


class IngresseSdk {
    /**
     * Initialize Ingresse API's SDK
     *
     * @param {object} [settings] - SDK configuration settings
     */
    constructor(settings = {}) {
       this._init(settings);
    }

    /**
     * Sdk Version
     *
     * @returns {string}
     */
    static version() {
        return version;
    }

    /**
     * Initialize API's configurations
     *
     * @param {object} settings - SDK settings.
     */
    _init(settings = {}) {
        let apiList = settings.apis || Object.keys(apis);

        apiList.map((key) => {
            let Api = apis[key];

            if (Api) {
                let options = settings[key] || null;
                this[key]   = new Api(options);
            }
        });
    }
}

module.exports = IngresseSdk
module.exports.default = IngresseSdk

import popsicle from 'popsicle';
import {plugins} from 'popsicle';
import {basePrefix, transformResponse} from './plugins';
import {auth} from '../auth';
import status from 'popsicle-status';


export class RequestHandler {
    /**
     * Initialize request handler
     *
     * @param {object} settings - Settings
     */
    constructor(settings = {}) {
        this.settings = settings;

        if (auth[settings.auth]) {
            this.auth = new auth[settings.auth]();
        }
    }

    /**
     * Create new request promise
     *
     * @private
     * @param {object} options - request options.
     *
     * @returns {Promise}
     */
    request(options = {}) {
        let request = {
            headers: {
                'User-Agent': 'Ingresse JS SDK',
            },
        };

        if (this.auth) {
            Object.assign(request, this.auth.getSettings());
        }

        Object.assign(request, options);

        return popsicle(request)
            .use(transformResponse())
            .use(basePrefix(this.settings.url))
            .use(plugins.parse(['json']));
    }

    /**
     * Get resource
     *
     * @param {string} path    - Request get to endpoint e.g. /api-path/1
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    get(path, query) {
        let request = {
            method: 'GET',
            url   : path,
            query : query,
        };

        return this.request(request);
    }

    /**
     * Post resource
     *
     * @param {string} path    - Request post to endpoint e.g. /api-path
     * @param {object} data    - Data to be posted.
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    post(path, data, query) {
        let request = {
            method: 'POST',
            url   : path,
            data  : data,
            query : query,
        };

        return this.request(request);
    }

    /**
     * Put resource
     *
     * @param {string} path    - Request put to end endpoint e.g. /api-path/1
     * @param {object} data    - Data to be updated.
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    put(path, data, query) {
        let request = {
            method: 'PUT',
            url   : path,
            data  : data,
            query : query,
        };

        return this.request(request);
    }

    /**
     * Delete resource
     *
     * @param {string} path    - Request delete to endpoint e.g. /api-path/1
     * @param {object} [query] - Optional request parameters.
     *
     * @returns {Promise}
     */
    delete(path, query) {
        let request = {
            method: 'DELETE',
            url   : path,
            query : query,
        };

        return this.request(request);
    }
}

/**
* Middleware to format all request with a base URL
*
* @params {string} base - Base URL for all requests.
*
* @returns {function}
*/
export var basePrefix = (base = '') => {
    return (request, next) => {
        let path = request.url.replace(/^\//, '');
        base = base.replace(/\/$/, '');

        request.url = `${base}/${path}`;

        return next();
    };
};

/**
 * Handle response from api and decide
 * based on the status code if the request
 * was a success or an error
 *
 * @params {number} [lower=200]  - Lower status code number.
 * @params {number} [higher=299] - Higher status code number.
 *
 * @returns {function}
 */
export var transformResponse = (lower = 200, higher = 299) => {
    return (request, next) => {
        return next().then((response) => {
            if (response.status >= lower &&
                response.status <= higher) {

                return response.body;
            }

            var error = request.error('', 'EINVALIDSTATUS');
            error.body = response.body;

            return error.body;
        });
    };
};
